import React from "react";
import { Fragment } from "react/cjs/react.production.min";
import './skillCard.css';
import html from '../../Assets/html.png';

const SkillCard=()=>{

    return(
        <Fragment>
         <div className="skill_card" onMouseEnter={enter}>
             <div className="skill_card_img">
                 <img className="skill_img" src={html}></img>
             </div>
             <div className="skill_card_details">
                 <div className="skill_card_header">HTML</div>
                 <div className="skill_card_details">
                     <ul>
                         <li>My Level : 90%</li>
                         <li>Used in this Project : 10%</li>
                     </ul>
                 </div>
             </div>
         </div>
        </Fragment>
    );

};

export default SkillCard;
